#import "MyParamterArray.h"@implementation MyParamterArrayconst unsigned		maxParameters = 12;- (id)	init{	NSMutableDictionary		*myDict;		[super init];		myArray = [[NSMutableArray alloc] init];		for (i = 0; i < maxParameters; i++) {		myDict  = [[NSMutableDictionary alloc] init];		[myDict		setObject:@"Anderson" forKey:@"Last Name"];		[myDict		setObject:@"James" forKey:@"First Name"];		[myDict		setObject:@"apartment" forKey:@"Abode"];		[myDict		setObject:@"San Francisco" forKey:@"City"];		[myArray	addObject:myDict];		[myDict		release];	}		return self;}        - (id)tableView:(NSTableView *)theTableView 	objectValueForTableColumn:(NSTableColumn *)column    row:(int)rowIndex{	return [[myArray objectAtIndex:rowIndex] objectForKey:[column identifier]];}- (int)numberOfRowsInTableView:(NSTableView *)aTableView{    return [myArray count];}- (void) dealloc{	[myArray	release];}@end